    const [state, setState] = useState(null)
    useEffect(()=>{
        console.log('work')
            switch (text.page){
                case 'main':
                    setState(main);
                    break;
                case 'noMain':
                    setState(noMain)
                    break;
            }
        },[text.page])
    return (
        <div className={'rightBlock'}>
            <div className={'headerImage'}>
                <div className={'grad'}></div>
            </div>

            <div>
                <h1>МУП Платнировский «Универсал»</h1>
                {state}
            </div>
        </div>
    );
});

export default RightBlock;
